import styled from 'styled-components';


const Styledimg = styled.img`
height:70px;
width:100px;
object-fit:contain;
`;
const StyledLi = styled.li`
    display:flex;
    align-items:center;
    cursor: pointer;
    transition: ease-in-out 0.3s
    &:hover {
        background: #BFC0C3;
    }
`;

const FilterSearch = ({itemName,itemImg}) => {

    return(
        <StyledLi>
            <Styledimg src={itemImg}/>
            {itemName}
        </StyledLi>
    );
}

export default FilterSearch;
